USE YourDatabaseName;\nGO\n\n-- Function to read the transaction log\nSELECT \n    [Current LSN],\n    [Operation],\n    [Transaction ID],\n    [Begin Time],\n    [End Time],\n    [Object Name]\nFROM \n    fn_dblog(NULL, NULL)\nWHERE \n    [Operation] = 'LOP_BEGIN_XACT' \n    AND [Begin Time] BETWEEN 'YYYY-MM-DD HH:MM:SS' AND 'YYYY-MM-DD HH:MM:SS'\n    AND [Transaction Name] = 'YourStoredProcedureName';\nGO